INSERT INTO `blog` VALUES ('6', 'тест', 'test', '<h1><a href=\"https://gatakka.eu/?p=1849\">Използване на UV лампи за дезинфекция в домашни условия</a></h1>\r\n\r\n<p><a href=\"https://gatakka.eu/?p=1849#comments\">7 коментара</a></p>\r\n\r\n<p>Ще се опитам да съм много кратък. UV лампите може да са изключително ефективен начин да избиете всякакви вируси, дори в домашни условия НО, има няколко големи НО:</p>\r\n\r\n<h2>Спектър</h2>\r\n\r\n<p>UV спектъра е разделен на 3 основни категории&nbsp;<strong>A</strong>,<strong>B&nbsp;</strong>и<strong>&nbsp;C</strong>. Разликата между тях е честотната им лента.</p>\r\n\r\n<p>UV-A е с дължина на вълната между 315&ndash;400 нанометра, и това е основното UV което получаваме от слънцето. Тази светлина&nbsp;<strong>НЯМА</strong>&nbsp;анти бактериално или анти микробно действие.</p>\r\n\r\n<p>UV-B е с дължина на вълната 280&ndash;315 нанометра, и голяма част от този спектър се абсорбират от атмосферата, до земната повърхност пристига много малко количество. Те имат много слабо анти бактериално или анти микробно действие. Този спектър е необходим за образуването на Витамин D в тялото и той е виновен за слънчевите изгаряния и тена.</p>\r\n\r\n<p>UV-C е с дължина на вълната от 100&ndash;280 нанометра. Този спектър НЕ достига до земната повърхност, понеже е напълно абсорбиран от атмосферата. UV-C са изключително ефективни срещу всичко живо. Тази светлина могат да унищожат почти всяка бактерия или вирус, както и човешките клетки.</p>\r\n\r\n<p>Тоест, ако искате да правите подобни неща, в идеалният случай, ви трябва лампа която излъчва ~254 нанометра. Такива са налични комерсиално, приличат на флуоресцентни лампи, но без бялото вътрешно покритие. Монтират се на стандартни фасунги, работят със стандартно напрежение и стандартен баласт. Накратко, просто я завивате и я пускате.</p>\r\n', null, null, null);
INSERT INTO `blog` VALUES ('7', 'Режисьорът Аарън Русо за микрочиповете и плановете за световно поробване', 'rezhisort-aarn-ruso-za-mikrochipovete-i-planovete-za-svetovno-porobvane', '<p>&nbsp;В&nbsp;историческо последно интервю, филмовият продуцент и музикален мениджър Аaрън Русо споделя вътрешната информация, доверена му лично от член на фамилията Рокфелер. На Русо е било казано (11 месеца преди 11-ти септември 2001) за плановете да бъдат нагласени терористични атаки, да се нападнат чужди държави и да се въведе високо-технологична мрежа за контрол, която ще следи всяка стъпка на населението чрез имплантиране на RFID микрочипове.</p>\r\n\r\n<iframe src=\"https://www.youtube.com/embed/sNItr1oYo2c\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\r\n', null, null, null);
