INSERT INTO `product` VALUES ('5860', '292S-3346', 'Samsung', 'Смартфон Samsung Galaxy S20 Plus, Dual SIM, 128GB, 8GB RAM, 4G, Cosmic Black', 'smartfon-Samsung-Galaxy-S20-Plus-Dual-SIM-128GB-8GB-RAM-4G-Cosmic-Black', '1710.00', '1500.12', 'На склад', 'Чехия', '2', 'https://www.youtube.com/embed/1GaurFrlGgo', null, 'http://set.host/image/stored/1586037422-7754.jpeg', '2020-03-30', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/6fEQJYCjTXM\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 'Запознайте се с Galaxy S20, S20+ и S20 Ultra. Революционният 8K видеокадър променя начина, по който снимате не само видео, но и фотография, а 5G променя начина, по който споделяте. Добавете сигурност Samsung Knox, интелигентна батерия, мощен процесор и огромно пространство за съхранение — и серията Galaxy S20 разкрива изцяло нов свят за мобилните устройства.', '0', '0', null, null, '2020-04-10 14:39:28', '20200410', '1', '0', '0');
